    return (
        <div className="sidebar bg-primary text-white vh-100">
            <ul className="nav flex-column p-3">
                <li className="nav-item">
                    <a href="#" className="nav-link text-white">
                        <i className="fas fa-home me-2"></i> Home
                    </a>
                </li>
            </ul>
        </div>
    );
};
